import React from "react";
import "../stylesheets/Home.css";
import pizza from "../Images/pizza.jpg";

const Home = () => {
  return (
    <div className="body col-6 col-md-12">
      <div className="content">
        <h1>Welcome to React Meals!</h1>
        <h2>Serving Fresh and Delecious!</h2>
      </div>
      <div className="image">
        <img src={pizza} alt="" />
      </div>
    </div>
  );
};

export default Home;
